        initLanguages: function() {
            $('.languages').on('mouseenter', function(e) {
                if (clientInfo.mobile) return;
                $(this).addClass('active');
            });
            $('.languages').on('mouseleave', function(e) {
                if (clientInfo.mobile) return;
                $(this).removeClass('active');
            });
            $('.languages .language').on('click', function(e) {
                if (!clientInfo.mobile) return;
                if (!$(this).closest('.languages').hasClass('active')) {
                    $(this).closest('.languages').addClass('active');
                } else {
                    $(this).closest('.languages').removeClass('active');
                }
            });
            $(document).on('click', function(e) {
                if (!clientInfo.mobile) return;
                if ($(e.target).is('.languages .language') || $(e.target).closest('.languages .language').length) return;
                $('.languages').removeClass('active');
            });
        },

