        initModal: function() {
            // Actions on modal opening
            cs.modalWindow.on('open', function(e, params) {
                var modal = $('.modal__window[data-modal-type="' + params.modalType + '"]');

                // close all active windows
                if (!params.modalPart) {
                    $('.modal__window.active').each(function() {
                        $(this).trigger('close', {modalType: $(this).attr('data-modal-type')});
                    });
                }

                // if (params.modalType == 'authorization') {
                if (modal.hasClass('modal__window--bg')) {
                    if (modal.hasClass('active')) {
                        modal.addClass('part-changed');
                    }
                }

                modal.addClass("active");

                // Custom code
                // if (params.modalType == 'authorization') {
                if (modal.hasClass('modal__window--bg')) {
                    if (params.modalPart) {
                        setTimeout(function() {
                            var modalParts = modal.find('.js_modal-part').removeClass('active');
                            modal.find('.js_modal-part')
                                .filter('[data-modal-part=' + params.modalPart + ']').addClass('active');
                        }, 100);
                    }
                }
                //
            });
            // Actions on modal closing
            cs.modalWindow.on('close', function(e, params) {
                var modal = $('.modal__window[data-modal-type="' + params.modalType + '"]');
                modal.removeClass("active");

                // Custom code
                // if (params.modalType == 'authorization') {
                if (modal.hasClass('modal__window--bg')) {
                    modal.removeClass('part-changed')
                    setTimeout(function() {
                        modal.find('.js_modal-part').removeClass('active');
                    }, 350);
                }
                //
            });


            // Open modal trigger
            $('.js_modal-open').on('click', function(e){
                e.preventDefault();

                var params = {};
                    params.modalType = $(this).data('modal-type');
                var modal = cs.modalWindow.filter('[data-modal-type="' + params.modalType + '"]');

                // Custom code
                var modalPart = $(this).data('modal-part');
                if (modalPart) {
                    params.modalPart = modalPart;
                }
                modal.trigger('open', params);
            });

            // Keyboard ESC close modal trigger
            $(document).on('keyup', function(e) {
                var params = {};

                if (e.which == 27) {
                    $('.modal__window.active').trigger('close', {modalType: $('.modal__window.active').attr('data-modal-type')});
                }
            });

            // Button close modal trigger
            $(document).on('click', '.js_modal-close', function(e) {
                e.preventDefault();
                var params = {};
                    params.modalType = $(this).closest('.modal__window').data('modal-type');

                if (!$(this).closest('.modal__window').hasClass("modal__window--no-close")) {
                    // cs.modalWindow.trigger('close', params);
                    $(this).closest('.modal__window').trigger('close', params);
                }
            });

            // Close modal by clicking on dark area 
            cs.modalWindow.on('click', function(e) {
                var params = {};

                if ($(this).hasClass('modal__window--bg')) return;

                params.modalType = $(this).attr('data-modal-type');

                if (!$(e.target).closest('.modal__wrapper').length && !$(this).hasClass("modal__window--no-close")) {
                    $(this).trigger('close', params);
                }
            });


            // Custom scroll of modal window on desktop
            if (!clientInfo.mobile) {
                $('.modal__window').each(function(){
                    var modal = $(this);

                    if (modal.hasClass('modal__window--gallery')) return; 

                    if (modal.hasClass('modal__window--bg')) {
                        modal.find('.modal__wrapper').mCustomScrollbar({
                            scrollbarPosition: 'outside',
                            scrollInertia: 0
                        });
                    } else {
                        modal.mCustomScrollbar({
                            scrollbarPosition: 'outside',
                            scrollInertia: 0
                        });
                    }
                });
            }

        },

