        initEditable: function() {
            $(document).on('click', function(e) {
                var $this = $(e.target);

                if ($this.hasClass('js_editable-cell') || $this.closest('.js_editable-cell').length)  {
                    var editableCell = $this.hasClass('js_editable-cell') ? $this : $this.closest('.js_editable-cell');
                    if (editableCell.hasClass('cell-editing')) return true;
                
                    var editableBlock = editableCell.find('.js_editable'),
                        editableValue = editableBlock.find('.js_editable-value'),
                        textarea = editableBlock.find('textarea'),
                        table = editableCell.closest('table'),
                        columnCells = table.find('td.' + editableCell.attr('data-cell')),
                        editableActive = $('.js_editable.active');

                    if (editableActive.length) {
                        closeEditable();
                    }
                    textarea.val(editableValue.text().trim());
                    editableBlock.addClass('active');
                    editableCell.addClass('cell-editing');
                    table.addClass('table-editing');
                    columnCells.addClass('column-editing-active');
                    textarea.focus();
                } else if ($('.js_editable.active').length) {
                    closeEditable();
                }
            });

            function closeEditable() {
                var editableActive = $('.js_editable.active'),
                    activeCell = editableActive.closest('td'),
                    editableValue = editableActive.find('.js_editable-value'),
                    currentValue = editableValue.text().trim(),
                    textareaValue = editableActive.find('.js_editable-textarea').val().trim();

                editableActive.removeClass('active');
                if (currentValue !== textareaValue ) {
                    editableValue.text(textareaValue);
                    activeCell.addClass('comment-saved');
                    setTimeout(function() {
                        activeCell.removeClass('comment-saved');
                    }, 500);
                }
                $('.column-editing-active').removeClass('column-editing-active');
                activeCell.removeClass('cell-editing');
                $('.table-editing').removeClass('table-editing');
                cs.checkEditableHeight();
            }
        },

        checkEditableHeight: function() {
            $('.js_editable-value-container').each(function() {
                var innerBlock = $(this).find('.js_editable-value');
                if (innerBlock.outerHeight() > $(this).outerHeight()) {
                    $(this).addClass('overflowed');
                } else {
                    $(this).removeClass('overflowed')
                }
            });
        },

